import React from "react";

import Navbar from "../common/navbar/navbar";
import Footer from "../common/footer/footer";
import NotificationsTable from "./notifications-table.js";
import Title from "../common/title/title.js";

const DATA = [
  {
    id: "1",
    sender: "mollaahmadi",
    type: "buy-list",
    "targetGroup": "mollaahmadi-family",
    "buy-list": [
      {
        id: "1",
        name: "شامپو تخم مرغی صحت",
        description: "نداشت نگیر"
      },
      {
        id: "2",
        name: "سس گوجه فرنگی",
        description: "فقط دلپذیر باشه ها"
      }
    ]
  },
  {
    id: "2",
    sender: "mahlagha",
    type: "join-to-my-group",
    "targetGroup": "hamsayeha",
    "buy-list": []
  },
  {
    id: "3",
    sender: "ali",
    type: "join-me-to-other-group",
    "targetGroup": "itc",
    "buy-list": []
  },
  {
    id: "4",
    sender: "sepanta",
    type: "disjoin-from-my-group",
    "targetGroup": "khabgah",
    "buy-list": []
  },
  {
    id: "5",
    sender: "mahlagha",
    type: "disjoin-me-from-other-group",
    "targetGroup": "غضنفر و دوستان",
    "buy-list": []
  }
];

class NotificationsPage extends React.Component {
  render() {
    return (
      <div>
        <Navbar isLogin="true" />

        <div className="my-body">
          <Title text="اعلام ها" />
          <NotificationsTable data={DATA} />
        </div>

        <Footer />
      </div>
    );
  }
}

export default NotificationsPage;
